import React from 'react';
import './App.css';
import Technologylist from "./technologies/technologylist";

function App() {
    return (
        <div className="App">
            <header className="App-header">
                {/*<Technologylist/>*/}
                <p>
                    Edit <code>src/App.js</code> and save to reload.
                </p>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Learn React
                </a>
            </header>
        </div>
    );
}

export default App;
